import React from 'react';
import * as ReactBootStrap from "react-bootstrap";
import Header from './Header';




class Login extends React.Component {
  constructor(props) {
    super(props);
    this.state = { seconds: 0 };
  }

  tick() {
    this.setState(state => ({
      seconds: state.seconds + 1
    }));
  }

  componentDidMount() {
    this.interval = setInterval(() => this.tick(), 1000);
  }

  render() {
    return (
      <div>
      
      <Header/>
     
      <br></br>
      <br></br>
      <div class="container col-md-4 col-md-offset-4 center_div">
        <form >
            <div class="form-group">
              <label for="exampleInputUsername">Username</label>
              <input type="username" class="form-control" id="exampleInputUsername" aria-describedby="usernameHelp"></input>
              <small id="usernameHelp" class="form-text text-muted" >Unique username.</small>
            </div>

            <div class="form-group">
              <label for="exampleInputPassword1">Password</label>
              <input type="password" class="form-control" id="exampleInputPassword1"></input>
            </div>

            <br></br>

            <button type="submit" class="btn btn-primary">Login</button>
        </form>
        
      </div>

      </div>
    );
  }


}
  
  export default Login;
